import Props from "./props";



let App = () => {
  return (

      <div className="container my-5">
        <div className="row">
          <Props/>
         <Props 
         img="https://images.pexels.com/photos/753575/pexels-photo-753575.jpeg?auto=compress&cs=tinysrgb&dpr=2&w=500"
         title="A black forest"
         />
         <Props
         img="https://images.pexels.com/photos/9136849/pexels-photo-9136849.jpeg?auto=compress&cs=tinysrgb&dpr=2&w=500"
         title="A handsum pose"
         />
